import React,{Component} from 'react'
// import mongoose from 'mongoose';
// import Axios from 'axios'
import '../styles/cards.css'
import Header from '../layout/Header'
import Footer from '../layout/Footer'
import Cards from '../Cards'


class Home extends Component{
    state={
        datos:{}
    }
    // componentDidMount(){
    //     Axios.get(URL_MONGO)
    //         .then(res => {this.setState({datos:res.data})})
    //         .catch(err => console.log(err));
    // }
    render(){
        return(
            <div className="home">
                <Header />
                <h2 className="encabezados">Ultimos Lanzamientos</h2>
                <Cards 
                img='https://upload.wikimedia.org/wikipedia/en/0/0d/Avengers_Endgame_poster.jpg'
                titulo='Avengers: End Game'
                sinopsis='Lorem Ipsum'
                />
                                <Cards 
                img='https://img04.mgo-images.com/image/thumbnail?id=MMV1EB58C939DBFDAD919D1F10D305CC0F59&ql=70&sizes=310x465'
                titulo='Aquaman'
                sinopsis='Tras los acontecimientos de la Liga de la Justicia, Arthur Curry, el renuente gobernante del reino submarino de Atlantis, se ve atrapado en una batalla entre habitantes de la superficie, que amenazan a sus océanos, y su propia gente, que están dispuestos a atacar e invadir la superficie.'
                />
                <h2 className="encabezados">Más Visitados</h2>
                <Cards 
                img='https://upload.wikimedia.org/wikipedia/en/0/0d/Avengers_Endgame_poster.jpg'
                titulo='Avengers: End Game'
                sinopsis='Lorem Ipsum'
                />
                <h2 className="encabezados">Mejor Calificados</h2>
                <Cards 
                img='https://upload.wikimedia.org/wikipedia/en/0/0d/Avengers_Endgame_poster.jpg'
                titulo='Avengers: End Game'
                sinopsis='Lorem Ipsum'
                id='1'
                amount='250'
                />
                <Footer />
            </div>
        )
    }
}
export default Home
